    "2013-03-15T23:31:03.566007",nt"name": "ground-water-conditions-in-the-east-shore-area-box-elder-davis-and-weber-counties-uta-1960-1969",nt"isopen":
    false,nt"url": null,nt"notes": "The East Shore area is in north-central
    Utah between the east shore of Great Salt Lake and the Wasatch Range. The climate
    is semiarid. The growth of industry and agriculture and the related increase in
    population has steadily increased the demand for adequate water supplies in the
    East Shore area. The population was about 225,000 persons in 1970, an increase of
    about 47,000 since 1960. Annual ground-water withdrawals through large-diameter
    wells for municipal and industrial supply increased from about 10,000 acre-feet
    in 1960 to about 21,000 acre-feet in 1969. Additional pumpage from large-diameter
    wells for irrigation and other purposes was about 5,500 acre-feet in 1969; most
    of the water that is used for agriculture is supplied by surface-water sources.
    Discharge from small-diameter, chiefly flowing, wells is estimated to be 12,000
    acre-feet per year.n",nt"license_title": null,nt"extras": [{ntt"key":
